import React from 'react'

const ProfileTabs = ({ item, onClick }) => {
  function handleClick(e) {
    onClick(e.target)
  }
  return(
    <li className="list" data-target={item} onClick={handleClick}>
      {item}
    </li>
  )
}

export default ProfileTabs
